    render(){
        return(
            <div>
                <h1 className="title-container__title">Weather Finder</h1>
                <h3 className="title-container__subtitle">Stay updated with weather in your area. Find out temperature, conditions and more...</h3>
            </div>
        );
    }
}

export default Title;
